import React, { useState } from'react';
import './App.css';
import Form from './Components/Form';
import Navbar from './Components/Navbar';
import SkillsList from './Components/SkillsList';
import Login from './Components/Login';
import axios from 'axios';

import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';





function App() {
  // State stuff
  const [inputText, setInputText] = useState("");
  const [skills, setSkills] = useState([]);
  const [logins, setLogins] = useState({});
  const [loggedIn, setLoggedIn] = useState({})

  // Functions



  function updateLogins(e) {
    setLogins({...logins, [e.target.name]:e.target.value})
  }

  const submitHandler = (e) => {
    e.preventDefault();

    const userObject = {
      userName : logins.username,
      userPassword: logins.password
    };
    axios.post('http://localhost:3001/add-user', userObject)
      .then((res) => {
        console.log(res.data)
      }).catch((error) => {
        console.log(error)
      });
      setLogins({});
  }

  const loadUsers = () => {
    const response = axios.get('http://localhost:3001/all-users', )
    .then((response) => {console.log(response)})
  } 



  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className='app-container'>
        <h1 className='app-name'>Level Up App</h1>
        <Switch>

          <Route path='/home'>

            <Form inputText={inputText} setInputText={setInputText} skills={skills} setSkills={setSkills} />
            <SkillsList skills={skills} setSkills={setSkills} />

          </Route>
          <Route path='/login'> 
            <Login />
          </Route> 

        </Switch>
        </div>
      </div>
    </Router>

  );
}

export default App;
